#!/usr/bin/perl -w

use strict;
use warnings;

use File::Spec;
use Getopt::Long;
use DBI;

# Custom libraries
use MyLibGT::DBapp qw( :all );

my $VERSION = '1.04';

###
# Default Options
my $CFG_DB = '/home/alessandro/src/D/django_gtdb2/django/mysite/local_settings.json';
my $SESSION = 'default'; # 'gtdb2_cof'
my $TAXONOMY;	# Bacteria, Virus|Phage, etc.

###
# Parse input data
GetOptions(
	'cfg_db=s'   => \$CFG_DB,
	'session=s'  => \$SESSION,
	'taxonomy=s' => \$TAXONOMY,
) or die &usage();

$TAXONOMY || die &usage("\x1b[31mERROR\x1b[0m: empty TAXONOMY.");

my $infile = $ARGV[0];	# statistic_Streptomyces_phages_TTA-vs-FS_genes.tsv

# idexies of @misc
my( $NUM_COFS, $NUM_FS_GENES_in_COFS, $NUM_TTA_GENES_in_COFS, $NUM_FS_and_TTA_GENES_in_COFS, 
		$ACC_IDs, $COF_IDs, $FS_IDs, $WOFS_IDs, $GENE_IDs,
		$GENOME_LEN, $HOST_ID_gtdb2, $HOST_NAME, $FS_and_TTA_LIST
	);

my $inHd = "TAXON	ORG_ID	ORG_NAME	NUM_GENES	NUM_TTA_GENES	NUM_FS_GENES	NUM_FS_and_TTA_GENES	";

if( $TAXONOMY =~/^(?:Virus|Phage)/i ){
	$infile ||= 'statistic_Streptomyces_phages_TTA-vs-FS_genes.tsv';
	$inHd .= "GENOME_LEN	HOST_ID\\(gtdb2\\)	HOST_NAME	FS_and_TTA_LIST";
	$TAXONOMY = 'Viruses';

	( $GENOME_LEN, $HOST_ID_gtdb2, $HOST_NAME, $FS_and_TTA_LIST ) = (0 .. 3);

}elsif( $TAXONOMY =~/^Bacter/i ){
	$infile ||= 'statistic_TTA-vs-FS_genes.tsv';
	$TAXONOMY = 'Bacteria';

	( $NUM_COFS, $NUM_FS_GENES_in_COFS, $NUM_TTA_GENES_in_COFS, $NUM_FS_and_TTA_GENES_in_COFS, 
		$ACC_IDs, $COF_IDs, $FS_IDs, $WOFS_IDs, $GENE_IDs ) = (0 .. 8);

}else{
	die &usage("\x1b[31mERROR\x1b[0m: unknown TAXONOMY='$TAXONOMY'");
}

# Read DataBase configurations
my( $dbh, $gtdb_dir ) = read_configDB( $SESSION, $CFG_DB );

my $save_db = SaveDB;

my $i = 0;
my $no = 1;

# Читаем файл и записываем в DB
open( INFILE, $infile ) or die &usage("\x1b[31mERROR\x1b[0m: Can't find $infile. $!");
while(<INFILE>){
	s/^\s+|\s+$//g;
	next if /^$/;

	if( /^#/ ){
		if( /TAXONOMY=(\S+)/i ){
			my $m = $1;
			die &usage("\x1b[31mERROR\x1b[0m: taxonomies don't match '$m' != '$TAXONOMY'") if $TAXONOMY !~/^$m$/i;
		}
		next;
	}

	if( /^TAXON/ ){
		if( /^$inHd/ ){
			$no = 0;
			next;
		}
		die &usage("\x1b[31mERROR\x1b[0m: wrong format of input!");
	}

	next if $no;

