# TAXONOMY=Phage
TAXON	ORG_ID	ORG_NAME	NUM_GENES	NUM_TTA_GENES	NUM_FS_GENES	NUM_FS_and_TTA_GENES	GENOME_LEN	HOST_ID(gtdb2)	HOST_NAME	FS_and_TTA_LIST(;)
10702	5895	Streptomyces phage VWB	61	0	5	0	49220	3718	Streptomyces venezuelae	
1913034	5921	Streptomyces phage Joe	81	2	4	2	48941	972	Streptomyces coelicolor A3(2)	39050-39574:-:39435:-1;39050-39574:-:39342:+1
=cut
	my( $TAXON, $ORG_ID, $ORG_NAME, $NUM_GENES, $NUM_TTA_GENES, $NUM_FS_GENES, $NUM_FS_and_TTA_GENES, @misc ) = split /\t/;

	next if $TAXON !~/^\d/ or $ORG_ID !~/^\d/;

	print ++$i, ") Preparing organism: $ORG_NAME\n";

	unless( $NUM_GENES ){
		warn "	NUM_GENES = 0:	SKIPPED\n";
		next;
	}

	# Check ORGANISM in DB
	unless( $dbh->selectrow_array( qq{ SELECT value FROM org_params WHERE name='taxonomy' AND value="$TAXONOMY" AND parent_id=$ORG_ID LIMIT 1 } ) ){
		warn"	absent in the database:	SKIPPED\n";
		next;
	}

	for( $NUM_TTA_GENES, $NUM_FS_GENES, $NUM_FS_and_TTA_GENES ){
		$_ ||= 0;
	}

	next unless $save_db;

	my %tags =(
		'num_annotated_genes'   => [ qq{num=$NUM_GENES} ],
		'num_fshifts'           => [ qq{num=$NUM_FS_GENES} ],
		'tta__num_tta_genes'    => [ qq{num=$NUM_TTA_GENES} ],
		'tta__num_tta_fs_genes' => [ qq{num=$NUM_FS_and_TTA_GENES} ],	# , $qu_FS_and_TTA_LIST
	);

	if( $TAXONOMY =~/^(?:Virus|Phage)/i ){
		$tags{'virus_host_name'} = [ qq{value="$misc[ $HOST_NAME ]"}, qq{num=$misc[ $HOST_ID_gtdb2 ]} ];

		push @{ $tags{'tta__num_tta_fs_genes'} }, 'data=' . ($misc[ $FS_and_TTA_LIST ] ? qq{"$misc[ $FS_and_TTA_LIST ]"} : 'NULL');
	}

	# Upload into DB (ORG_PARAMS table) statistics of FS-,TTA-genes
	for( keys %tags ){
		&save_DB_info( $dbh, $ORG_ID, $_, $tags{$_} );
	}

}
close INFILE;
$dbh->disconnect();

die &usage("\x1b[31mERROR\x1b[0m: wrong format or empty input.") if $no;

exit;


sub save_DB_info {
	my( $dbh, $ORG_ID, $tag, $qq ) = @_;

	my $qu = join ', ', qq{name="$tag"}, qq{parent_id=$ORG_ID}, @{ $qq };

	my( $id ) = $dbh->selectrow_array( qq{ SELECT id FROM org_params WHERE name="$tag" AND parent_id = $ORG_ID LIMIT 1 } );
	if( $id ){
		$dbh->do( qq{ UPDATE org_params SET $qu WHERE id = $id } ) or warn $dbh->errstr;
	}else{
		$dbh->do( qq{ INSERT org_params SET $qu } ) or warn $dbh->errstr;
	}
}


sub usage {
	my( $msg ) = @_;
	$msg .= $msg ? "\n" : '';

	my $script = "\x1b[32m" . File::Spec->splitpath($0) . "\x1b[0m";
	return"$msg
$script version $VERSION
    Fills and/or updates 'org_params' table of 'GTDB2' database (default) with statistics
    from the <statistic.tsv> file

USAGE:
    $script [statistic.tsv] [OPTIONS]

EXAMPLE:
    ./$script statistic_Streptomyces_phages_TTA-vs-FS_genes.tsv -taxonomy Phage

HERE:
    <statistic.tsv>  --  By default, for Bacteria is 'statistic_TTA-vs-FS_genes.tsv',
                         for Virus|Phage is 'statistic_Streptomyces_phages_TTA-vs-FS_genes.tsv'.

OPTIONS:
    --cfg_db         --  DB configuration file. By default, 'django_gtdb2/django/mysite/local_settings.json'
    --session        --  session name/key in the DB configuration file. By default, 'default', i.e. 'gtdb2'
    --taxonomy       --  Bacteria, Virus|Phage, etc.
";
}
